import React, { useState } from "react";


function Greeting() {

    const name = useState()

    function handleChange(event) {

        return (event.target.value)
    }

    return (
        <div>
            <form>
                <label htmlFor="name">Name: </label>
                <input onChange={handleChange} id="name" />
            </form>
            {name ? <strong>Hello {name}</strong> : "Please type your name"}
        </div>
    );
}

function App() {
    return <Greeting />;
}

export default App;
